import SectionTitle from "./SectionTitle";

const About = ({ minHeight }) => {
  return (
    <section
      className="about wrapper"
      style={minHeight ? { minHeight: "50vh" } : null}
    >
      <SectionTitle title="About" />
      <p>
        This is another form of the world's longest continuous natural beach. On
        one side is a vast body of water. Approaching the beach, the calm and
        still waters suddenly took on a rough shape and gave birth to waves. And
        fell at the foot of the mountain forest waiting on the shore.
      </p>
    </section>
  );
};

export default About;
